import React from "react";
const AboutList = () => {
    return (
        <div className="list__container">
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Services</li>
                <li>Projects</li>
                <li>Contact</li>
            </ul>
        </div>
       
    );
    }
export default AboutList;
